import React from './topbar.css'

export default function Topbar() {
  return (
    <div class="top">
      <div class="topLeft"><i class="fa-brands fa-facebook"></i></div>
      <div class="topCenter">c</div>
      <div class="topRight">r</div>
    </div>
  )
}
